values = list(map(int, input().split()))firstLargest = -1secondLargest = -1for i in values:    if i > firstLargest:        firstLargest = ifor i in values:    if i > secondLargest:        if i != firstLargest:            secondLargest = iprint("First Largest:", firstLargest)print("Second Largest:", secondLargest)